import React from 'react' ;


const Home = () =>{

return(

    <div>
      <div className="row  ">
      <div className="col s12 main-column valign-wrapper center"> 
        <h3 className="center-align">Hello World </h3>
      </div>

      <div className="col s6 left-column"> 
        <h3>left World </h3>
      </div>

       <div className="col s6 right-column"> 
         <h3>Right World </h3>
        </div>
      </div>
      

    </div>

    );
}

export default Home ;
